import React, { useState } from 'react';
import axios from 'axios';
import Valyrian from '../assets/Valyrian.png';

const GamerForm = () => {
  const [gamerData, setGamerData] = useState({
    teamname: '',
    email: '',
    collegename: '',
    membernameone: '',
    membernametwo: '',
    membernamethree: '',
    membernamefour: '',
  });

  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    setGamerData({
      ...gamerData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('https://valyriansteelchallenge.onrender.com/api/gamers', gamerData);
      setMessage('Gamer details submitted successfully!');
    } catch (error) {
      setMessage('Failed to submit gamer details.');
      console.error('Error submitting gamer details:', error);
    }
  };

  return (
    <div className="relative min-h-screen bg-fixed bg-cover bg-center" style={{ backgroundImage: `url(${Valyrian})` }}>

<div className="bg-black bg-opacity-40 rounded-lg p-4 sm:p-6 md:p-8 shadow-lg w-full max-w-3xl sm:max-w-4xl md:max-w-5xl lg:max-w-6xl mx-auto">
        <h2 className="text-3xl font-bold text-white mb-6 text-center tracking-wider font-cinzeldecorative">Register Team</h2>
        <form onSubmit={handleSubmit} className="space-y-4">
          <div>
            <label className="block text-gray-300 text-lg font-semibold" htmlFor="teamname">Team Name</label>
            <input
              type="text"
              name="teamname"
              id="teamname"
              value={gamerData.teamname}
              onChange={handleChange}
              className="w-full px-4 py-2 bg-gray-700 text-white rounded-lg border border-gray-600 focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
          </div>
          <div>
            <label className="block text-gray-300 text-lg font-semibold" htmlFor="email">Email</label>
            <input
              type="email"
              name="email"
              id="email"
              value={gamerData.email}
              onChange={handleChange}
              className="w-full px-4 py-2 bg-gray-700 text-white rounded-lg border border-gray-600 focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
          </div>
          <div>
            <label className="block text-gray-300 text-lg font-semibold" htmlFor="collegename">College Name</label>
            <input
              type="text"
              name="collegename"
              id="collegename"
              value={gamerData.collegename}
              onChange={handleChange}
              className="w-full px-4 py-2 bg-gray-700 text-white rounded-lg border border-gray-600 focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
          </div>
          <div>
            <label className="block text-gray-300 text-lg font-semibold" htmlFor="membernameone">Team Member 1</label>
            <input
              type="text"
              name="membernameone"
              id="membernameone"
              value={gamerData.membernameone}
              onChange={handleChange}
              className="w-full px-4 py-2 bg-gray-700 text-white rounded-lg border border-gray-600 focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
          </div>
          <div>
            <label className="block text-gray-300 text-lg font-semibold" htmlFor="membernametwo">Team Member 2</label>
            <input
              type="text"
              name="membernametwo"
              id="membernametwo"
              value={gamerData.membernametwo}
              onChange={handleChange}
              className="w-full px-4 py-2 bg-gray-700 text-white rounded-lg border border-gray-600 focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
          </div>
          <div>
            <label className="block text-gray-300 text-lg font-semibold" htmlFor="membernamethree">Team Member 3</label>
            <input
              type="text"
              name="membernamethree"
              id="membernamethree"
              value={gamerData.membernamethree}
              onChange={handleChange}
              className="w-full px-4 py-2 bg-gray-700 text-white rounded-lg border border-gray-600 focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
          </div>
          <div>
            <label className="block text-gray-300 text-lg font-semibold" htmlFor="membernamefour">Team Member 4</label>
            <input
              type="text"
              name="membernamefour"
              id="membernamefour"
              value={gamerData.membernamefour}
              onChange={handleChange}
              className="w-full px-4 py-2 bg-gray-700 text-white rounded-lg border border-gray-600 focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
          </div>
          <button
            type="submit"
            className="w-full py-3 bg-blue-600 text-white font-bold text-lg rounded-lg hover:bg-blue-700 transition duration-300"
          >
            Submit
          </button>
        </form>
        {message && <p className="mt-4 text-center text-white">{message}</p>}
      </div>
    </div>
  );
};

export default GamerForm;
